import Logo from './pictures/logo3.png';
import {BellIcon, ChatIcon, PlusIcon, SearchIcon} from '@heroicons/react/outline'

function App() {
  return (
    <div>
      <header className="flex w-full bg-rd p-2">
        <div className='mx-4'>
        <img src={Logo} alt="" className="w-10 h-10 " />
        </div>
        <form action='' className='bg-rd-brighter p-1 px-3 flex rounded-md border border-gray-700'>
          <SearchIcon className='text-gray-300 h-7 w-7'/>
          <input type="text" className="bg-rd-brighter text-sm p-1 pl-2 pr-0 block focus:outline-none text-white" placeholder='Search'/>
        </form>
          <ChatIcon className='text-white w-8 h-8 m-1 mx-2'/>
          <BellIcon className='text-white w-8 h-8'm-1 mx-2 />
          <PlusIcon className='text-white w-8 h-8'm-1 mx-2 />
      </header>
    </div>
  );
}

export default App;
